import React from "react";
import { useEffect } from "react";
import { useState } from "react";
import axios from "axios";
import "./assets/css/style.css";

const Products = () => {
  //create a use statement
    const [products, setProducts] = useState([]);
  
    useEffect(() => {
      const fetchAllProducts = async () => {
        try {
          const res = await axios.get("http://localhost:8000/products");
          console.log(res.data)//specific the response
        } catch (err) {
          console.log(err)
        }
      };
      fetchAllProducts();
    }, [])
  

  return (
    <section class="products" id="products">
    <h1 class="heading">latest <span>products</span> </h1>

    <div class="box-container centered-container" id="productContainer">

    <div className="box">
    <span className="discount"></span>
    <div className="icon">
        <a href="#" className="fas fa-eye"></a>
        <a href="#" className="fas fa-edit"></a>
        <a href="#" className="fas fa-trash"></a>
    </div>
    <img src="assets/img/${image}" alt="${name}"/>
    <h3>name</h3>
    <div class="stars">
        <i class="fas fa-star"></i>
        <i class="fas fa-star"></i>
        <i class="fas fa-star"></i>
        <i class="fas fa-star"></i>
        <i class="fas fa-star-half-alt"></i>
    </div>
    <div class="price">
        price <span></span>
    </div>
    <div class="quantity">
        <span>quantity :</span>
        <input type="number" min="1" max="100" value="" />
        <span> /kg</span>
    </div>
    <a href="#" class="btn">add to cart</a>
  </div>

</div>
</section>
);
};

export default Products;
